SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;
SELECT DropGeometryColumn('','counties','geom');
DROP TABLE "counties";
BEGIN;
CREATE TABLE "counties" (gid serial,
"name" varchar(32),
"state_name" varchar(25),
"state_fips" varchar(2),
"cnty_fips" varchar(3),
"fips" varchar(5));
ALTER TABLE "counties" ADD PRIMARY KEY (gid);
SELECT AddGeometryColumn('','counties','geom','4326','MULTIPOLYGON',2);
CREATE INDEX "counties_geom_gist" ON "counties" USING GIST ("geom");
COMMIT;
